import BannerImage from "../Assets/home-banner-image.png";
import Navbar from "./Navbar";

const Home = () => {
    return (
        <div className="home-container">
            <Navbar />
            <div className="home-banner-container">
                <div className="home-bannerImage-container">
                </div>
                <div className="home-text-section">
                    <h1 className="primary-heading">
                        Your journey starts now
                    </h1>
                    <p className="primary-text">
                        Lorem ipsum dolor sit amet consectetur adipisicing elit. Voluptatem, sequi.
                    </p>
                    <button className="secondary-button">
                        Watch Now <span class="material-symbols-outlined">
                            arrow_forward_ios
                        </span><svg xmlns="http://www.w3.org/2000/svg" enable-background="new 0 0 24 24" height="24" viewBox="0 0 24 24" width="24"><g><path d="M0,0h24v24H0V0z" fill="none"/></g><g><polygon points="6.23,20.23 8,22 18,12 8,2 6.23,3.77 14.46,12"/></g></svg>
                    </button>
                </div>
                <div className="home-image-section">
                    <img src={BannerImage} alt="" />
                </div>
            </div>
        </div>
    );
};

export default Home;
